INSERT INTO `important_links` (`id`, `created_at`, `updated_at`, `key`, `name`, `description`, `url`) VALUES
(1, '2025-11-11 10:43:57', '2025-11-11 10:43:57', 'privacy_policy', 'سياسة الخصوصية', '<h2>سياسة الخصوصية</h2><p>نحن نحترم خصوصيتك ونلتزم بحماية بياناتك الشخصية. يتم استخدام البيانات لتحسين الخدمة وتقديم الدعم.</p>', '/privacy-policy'),
(2, '2025-11-11 10:43:57', '2025-11-11 10:43:57', 'return_policy', 'سياسة الاسترجاع', '<h2>سياسة الاسترجاع</h2><p>يمكنك استرجاع المنتجات خلال المدة المعلنة وضمن الشروط الموضحة هنا.</p>', '/return-policy'),
(3, '2025-11-11 10:43:57', '2025-11-11 10:43:57', 'warranty', 'الضمان', '<h2>الضمان</h2><p>تفاصيل الضمان، المدة، والحالات المشمولة وغير المشمولة بالضمان.</p>', '/warranty'),
(4, '2025-11-11 10:43:57', '2025-11-11 10:43:57', 'about_us', 'من نحن', '<h2>من نحن</h2><p>معلومات عن المتجر، رؤيتنا، ورسالتنا.</p>', '/about-us'),
(5, '2025-11-11 10:43:57', '2025-11-11 10:43:57', 'faq', 'الأسئلة الشائعة', '<h2>الأسئلة الشائعة</h2><p>جمع للأسئلة المتكررة وإجاباتها لراحة العملاء.</p>', '/faq'),
(6, '2025-11-11 10:43:57', '2025-11-11 10:43:57', 'join_us', 'انضم إلينا', '<h2>انضم إلينا</h2><p>فرص العمل والتطوع وكيفية التقديم للانضمام لفريقنا.</p>', '/join-us'),
(7, '2025-11-11 10:43:57', '2025-11-11 10:43:57', 'partners', 'الشركاء', '<h2>الشركاء</h2><p>قائمة بالشركاء والموردين مع نبذة عن التعاون.</p>', '/partners'),
(8, '2025-11-11 10:43:57', '2025-11-11 10:43:57', 'team', 'الفريق', '<h2>الفريق</h2><p>التعريف بأعضاء الفريق ووظائفهم وخبراتهم.</p>', '/team'),
(9, '2025-11-11 10:43:57', '2025-11-11 10:43:57', 'terms_conditions', 'الشروط والأحكام', '<h2>الشروط والأحكام</h2><p>الشروط التي تحكم استخدام الموقع والخدمات.</p>', '/terms-conditions'),
(10, '2025-11-11 10:43:57', '2025-11-11 10:43:57', 'contact_us', 'اتصل بنا', '<h2>اتصل بنا</h2><p>طرق التواصل معنا: الهاتف، البريد الإلكتروني، ونموذج التواصل.</p>', '/contact-us'),
(11, '2025-11-11 10:43:57', '2025-11-11 10:43:57', 'shipping_policy', 'سياسة الشحن', '<h2>سياسة الشحن</h2><p>تفاصيل الشحن، التكاليف، والمناطق المغطاة.</p>', '/shipping-policy');
