INSERT INTO `static_pages` (`id`, `title`, `slug`, `content`, `meta_title`, `meta_description`, `meta_keywords`, `status`, `created_at`, `updated_at`) VALUES
(1, 'سياسة الخصوصية', 'syas-alkhsosy', '<h1>سياسة الخصوصية</h1>\n<p>نحن نحترم خصوصيتك ونلتزم بحماية المعلومات الشخصية التي تقدمها لنا. تشرح هذه السياسة أنواع البيانات التي نجمعها وكيفية استخدامها ومشاركة هذه البيانات وحقوقك المتعلقة بها.</p>\n\n<h2>المعلومات التي نجمعها</h2>\n<ul>\n  <li>المعلومات الشخصية: مثل الاسم، البريد الإلكتروني، ورقم الهاتف عند التسجيل أو التواصل.</li>\n  <li>معلومات فنية: مثل عنوان الـ IP، نوع المتصفح، صفحات الموقع التي تزورها ومدة الزيارة.</li>\n</ul>\n\n<h2>كيف نستخدم المعلومات</h2>\n<p>نستخدم المعلومات لتحسين خدماتنا، التواصل معك، معالجة الطلبات، وإرسال إشعارات تتعلق بالخدمة عند الحاجة.</p>\n\n<h2>حماية البيانات</h2>\n<p>نتخذ إجراءات تقنية وإدارية لحماية بياناتك من الوصول غير المصرح به أو الفقدان أو التغيير.</p>\n\n<h2>مشاركة البيانات</h2>\n<p>لن نشارك معلوماتك الشخصية مع أطراف ثالثة إلا بموافقتك أو عند الحاجة لأداء الخدمة (مثل مزودي الدفع أو الشحن) أو إذا تطلبها القوانين.</p>\n\n<h2>حقوقك</h2>\n<p>لديك الحق في الوصول إلى بياناتك وتصحيحها وطلب حذفها ضمن نطاق القوانين المعمول بها. للتواصل بخصوص بياناتك، استخدم صفحة التواصل معنا.</p>', 'سياسة الخصوصية', 'تعرف على كيفية جمعنا واستخدامنا وحمايتنا لمعلوماتك الشخصية.', 'خصوصية, بيانات, سياسة الخصوصية', 'active', '2025-11-23 08:01:56', '2025-11-23 08:01:56'),
(2, 'سياسة الاسترجاع', 'syas-alastrgaaa', '<h1>سياسة الاسترجاع</h1>\n<p>نهدف إلى ضمان رضائك. إذا لم تكن راضيًا عن مشترياتك، يمكنك طلب استرجاع أو استبدال المنتج وفق الشروط التالية.</p>\n\n<h2>الشروط العامة</h2>\n<ul>\n  <li>يجب أن يُطلب الاسترجاع خلال <strong>14 يومًا</strong> من تاريخ استلام المنتج ما لم ينص العكس في صفحة المنتج.</li>\n  <li>يجب أن يكون المنتج في حالته الأصلية غير مستخدم وبالعبوة الأصلية مع ملحقاته.</li>\n</ul>\n\n<h2>حالات لا تقبل الاسترجاع</h2>\n<p>المنتجات التي تضررت بسبب استخدام خاطئ أو التي تم فتحها (في حال كانت محظور إعادة فتحها لأسباب صحية أو سلامة) قد لا تقبل الاسترجاع.</p>\n\n<h2>طريقة الطلب واسترداد المال</h2>\n<p>لطلب استرجاع، تواصل معنا عبر نموذج الاتصال مع رقم الطلب وسبب الإرجاع. بعد الموافقة، سنوضّح خطوات إرجاع المنتج وسيتم معالجة استرداد المدفوعات خلال 7-14 يوم عمل.</p>', 'سياسة الاسترجاع', 'شروط وإجراءات استرجاع واستبدال المنتجات.', 'استرجاع, استبدال, سياسة', 'active', '2025-11-23 08:01:56', '2025-11-23 08:01:56'),
(3, 'الضمان', 'aldman', '<h1>الضمان</h1>\n<p>نقدّم ضمانًا على بعض المنتجات وفق الشروط المبينة أدناه. تغطي سياسة الضمان عيوب التصنيع ولا تشمل الأضرار الناتجة عن سوء الاستخدام أو التعديلات غير المعتمدة.</p>\n\n<h2>مدة الضمان</h2>\n<p>تختلف مدة الضمان حسب نوع المنتج، ويتم ذكر فترة الضمان في صفحة كل منتج أو في الكتيب المرفق.</p>\n\n<h2>كيفية الاستفادة من الضمان</h2>\n<ul>\n  <li>احتفظ بإيصال الشراء أو رقم الطلب كدليل للاستفادة من الضمان.</li>\n  <li>في حال وجود عطل، تواصل مع خدمة العملاء لتوجيهك لإجراءات الإصلاح أو الاستبدال.</li>\n</ul>\n\n<h2>استثناءات</h2>\n<p>لا يشمل الضمان الأضرار الناتجة عن الحوادث، السقوط، التعرض للماء (ما لم ينص المنتج خلاف ذلك)، أو الإصلاحات من طرف ثالث غير معتمد.</p>', 'سياسة الضمان', 'تفاصيل وتغطية الضمان للمنتجات والخدمات.', 'ضمان, صيانة, إصلاح', 'active', '2025-11-23 08:01:56', '2025-11-23 08:01:56'),
(4, 'من نحن', 'mn-nhn', '<h1>من نحن</h1>\n<p>نحن شركة/منصة متخصصة في تقديم حلول وخدمات عالية الجودة لعملائنا. مهمتنا هي توفير تجربة سهلة وموثوقة تجمع بين الابتكار وخدمة العملاء المتميزة.</p>\n\n<h2>رؤيتنا</h2>\n<p>نسعى لأن نكون مرجعًا في مجالنا من خلال تقديم منتجات وخدمات تُحدث فرقًا حقيقيًا لدى المستخدمين.</p>\n\n<h2>قيمنا</h2>\n<ul>\n  <li>الجودة: نحرص على تقديم منتجات وخدمات بمعايير عالية.</li>\n  <li>الشفافية: نتعامل بوضوح وصدق مع عملائنا.</li>\n  <li>الابتكار: نبحث دائمًا عن تحسين وتطوير ما نقدمه.</li>\n</ul>\n\n<h2>تواصل معنا</h2>\n<p>لأي استفسار أو تعاون، يمكنك زيارة صفحة الاتصال أو التواصل عبر وسائل الاتصال المتاحة في الموقع.</p>', 'من نحن', 'نبذة عن الشركة، رسالتنا، ورؤيتنا.', 'من نحن, عن الشركة, نبذة', 'active', '2025-11-23 08:01:56', '2025-11-23 08:01:56'),
(5, 'الشروط والأحكام', 'alshrot-oalahkam', '<h1>الشروط والأحكام</h1>\n<p>باستخدامك لهذا الموقع أو خدماتنا، فإنك توافق على الالتزام بالشروط والأحكام التالية. الرجاء قراءتها بعناية.</p>\n\n<h2>الاستخدام</h2>\n<p>لا يجوز استخدام الموقع لأغراض غير قانونية أو مخالفة للنظام. يحتفظ الموقع بحق تعديل أو تعليق أو إيقاف الخدمات في أي وقت دون إشعار مسبق.</p>\n\n<h2>الملكية الفكرية</h2>\n<p>جميع المحتويات المنشورة على الموقع (نصوص، صور، شعارات) محمية بموجب حقوق الملكية ولا يجوز إعادة استخدامها دون إذن صريح.</p>\n\n<h2>المسؤولية</h2>\n<p>نسعى لتقديم معلومات دقيقة، لكن لا نضمن خلو الموقع من الأخطاء. لا نتحمل المسؤولية عن أي أضرار ناتجة عن استخدام المعلومات الواردة في الموقع إلا بقدر ما تسمح به القوانين المعمول بها.</p>\n\n<h2>التغييرات</h2>\n<p>قد يتم تعديل هذه الشروط من وقت لآخر. يستمر استخدامك للموقع بعد أي تعديل في اعتبارك موافقًا على الشروط المحدثة.</p>', 'الشروط والأحكام', 'الشروط والقواعد المنظمة لاستخدام الموقع والخدمات.', 'الشروط, الأحكام, استخدام الموقع', 'active', '2025-11-23 08:01:56', '2025-11-23 08:01:56'),
(6, 'الشركاء', 'alshrkaaa', '<h1>شركاؤنا</h1>\n<p>نفخر بالتعاون مع مجموعة من الشركاء المتخصصين في مجالات متعددة لضمان تقديم أفضل الحلول والخدمات لعملائنا.</p>\n\n<h2>شركاء استراتيجيون</h2>\n<p>نعمل مع شركاء في مجالات الشحن، الدفع الإلكتروني، الدعم الفني، والتسويق لضمان سلسلة قيمة متكاملة.</p>\n\n<h2>هل ترغب أن تصبح شريكًا؟</h2>\n<p>إذا كنت تمثل شركة أو مؤسسة وترغب في التعاون معنا، تواصل عبر صفحة الشراكات أو أرسل لنا بريدًا إلكترونيًا مع نبذة عن مجالك وما يمكنك تقديمه.</p>', 'الشركاء', 'معلومات عن شركائنا وفرص التعاون.', 'شركاء, تعاون, شراكات', 'active', '2025-11-23 08:01:56', '2025-11-23 08:01:56'),
(7, 'الفريق', 'alfryk', '<h1>فريق العمل</h1>\n<p>يتكون فريقنا من محترفين ذوي خبرة في مجالات تطوير المنتجات، التسويق، دعم العملاء، والعمليات. نعمل بتعاون وشغف لتحقيق أهداف الشركة وتقديم أفضل خدمة لعملائنا.</p>\n\n<h2>قادة الفريق</h2>\n<p>كل فريق يقوده مختصون لديهم رؤية واضحة وإدارة متمرسة تضمن جودة التنفيذ ومتابعة النتائج.</p>\n\n<h2>انضم إلينا</h2>\n<p>نرحب بالمواهب الجديدة. للاطلاع على فرص العمل أو إرسال سيرتك الذاتية، تواصل عبر صفحة الوظائف أو البريد الإلكتروني المخصص للتوظيف.</p>', 'فريق العمل', 'تعرف على فريق العمل وخبراتهم وفرص الانضمام.', 'فريق, موظفين, عن الفريق', 'active', '2025-11-23 08:01:56', '2025-11-23 08:01:56');
